.user-container {
    padding: 20px;
    max-width: 800px;
    margin: 0 auto;
}

.user-list {
    list-style: none;
    padding: 0;

    .user-item {
        display: flex;
        align-items: center;
        padding: 10px;
        border-bottom: 1px solid #eee;

        &.with-avatar {
            padding-left: 60px;
        }

        img {
            width: 40px;
            height: 40px;
            border-radius: 50%;
            margin-right: 10px;
        }

        .user-name {
            font-weight: bold;
            margin-right: 10px;
        }

        .user-email {
            color: #666;
        }
    }
}

.empty-message {
    text-align: center;
    color: #999;
    font-style: italic;
}

